// src/components/Navbar/NavbarProfessional.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';
//Home, Portfolio, Services, Skills, Contact
const NavbarProfessional = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/professional/portfolio">Portfolio</Link></li>
        <li><Link to="/professional/services">Services</Link></li>
        <li><Link to="/professional/skills">Skills</Link></li>
        <li><Link to="/professional/contact">Contact</Link></li>
      </ul>
    </nav>
  );
};

export default NavbarProfessional;
